import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Rakendus</h1>
      <div className="login-container">
        <input className="email" placeholder="E-mail" />
        <input className="salas6na" placeholder="salas6na" />
        <button className="sisselogimine"> Logi sisse </button>
        <a href="" className="registreeri">
          Registreeri kasutaja
        </a>
      </div>
    </div>
  );
}

export default App;
